import { IconButton } from '@material-ui/core'
import { VisibilitySharp } from '@material-ui/icons'
import React from 'react'
import  Table  from 'react-bootstrap/Table';
import { Link, useParams } from 'react-router-dom';
import AdminLink from '../management/AdminLinks';
import "./result.css"

function Result() {
    const {id}=useParams();
    const [quiz,setQuiz]=useState([])
    const [que,setQue]=useState([])
    const data = JSON.parse(localStorage.getItem('friend'));
    const jwt = data['jwt'];
    useEffect(() => {
        getAllResults();
    }, [])

    const getAllResults = async () => {
         const data={
           quizId:id
         }
        const options = {
            method: 'Post',
            headers: {
                "Apiuserid": "49507884",
                "Scope": "In.QuizApp.READ",
                "Authorization": `quizApp-oauthtoken ${jwt}`,
            }
        }
        const result = await services.getAllResults(data,options)
        console.log(result.data.data)
        setQuiz(result.data.data)
        setQue(JSON.parse(result.data.data[0].questionData))
    };
    return (
        <>
            <AdminLink/>
            <div className="detailView1">
              <div style={{width:"100%"}}>
                 <div className="cardTable">
                    <table className="viewtable">
                           <thead>
                            <tr>
                                <th>ID</th>
                                <th>Player Name</th>
                                <th>Played At</th>
                                <th>Score</th>
                                <th>View</th>
                            </tr>
                            </thead>
                            <tbody>
                            <tr>
                                <td>518</td>
                                <td>tanu</td>
                                <td>11/06/2020</td>
                                <td>6</td>
                                <td>
                                    <Link to="/playeranswer">
                                    <IconButton>
                                        <VisibilitySharp/>
                                    </IconButton>
                                    </Link>
                                </td>
                            </tr>
                        </tbody>
                    </table>
                 </div>
              </div>
            </div>
        </>
    )
}

export default Result
